export default class Lang {
    render(){

        function Lang() {
            return {
                'home' :'首页',
                'back' :'返回',
                'next' :'继续',
                'confirm' :'确定',
                'send' :'发送',
                'submit' :'提交',
                'subscrip' :'评论',
                'rank' :'评分',
                'rank_p' :'评价',

                'start' :'开始',
                'stop' :'停止',
                'pause' :'暂停',
                'download' :'下载',
                'delete' :'删除',
                'renew' :'更新',
                'replace' :'替换',
                'remove' :'移除',
            }
        }

    }
}
